#!/usr/bin/env python3
DNA = ''

lenght = len(DNA)
number_A = DNA.count('A')
number_T = DNA.count('T')
number_G = DNA.count('G')
number_C = DNA.count('C')
number_AT = number_A + number_T
AT_percentage = (number_AT/lenght)*100
print('The sequence is',lenght,'nucleotides')
print('There are',number_A,'A')
print('There are',number_T,'T')
print('The % of AT is',AT_percentage)
print('The % of GC is', 100-AT_percentage)

